I$("49e13ce73709982cf1c94a813d1f2e52", '<div>\n<p>\n1. 请首先检查您是否下载安装了直播客户端，若您未安装直播客户端，请在下载安装后重新尝试【去直播】。\n</p>\n<p>\n2. 若您已安装，却启动不了程序，请按照下述步骤操作：\n</p>\n<p>\n①、在“开始”菜单中找到“教育直播工具”，启动它；\n</p>\n<p>\n②、启动后需要填入一串代码，请复制下方代码\n</p>\n<p>\n<textarea name="name" rows="3" cols="80" readonly style="width:100%;">{str}</textarea>\n<ux-button-button-copy class="copy-btn" copyValue={str} copySuccessText="复制成功">复制</ux-button-button-copy>\n</p>\n<p>\n填入代码，确定后即可进入相应直播房间，若仍然有问题，请联系平台客服~\n<br>\n</p>\n<p style="color:#666;">\n暂时不支持Mac系统，请使用Windows系统进行直播。\n</p>\n</div>');
